"use strict";(self.webpackChunkmy_website=self.webpackChunkmy_website||[]).push([[3179],{9896:(e,t,o)=>{o.r(t),o.d(t,{assets:()=>l,contentTitle:()=>n,default:()=>h,frontMatter:()=>i,metadata:()=>s,toc:()=>d});var a=o(85893),r=o(11151);const i={slug:"keke",title:"Turning Point - Keke",authors:["jess"],tags:["vex","turning point","software","hardware","cad"]},n=void 0,s={permalink:"/projects/keke",source:"@site/projects/2019-04-30-keke/index.md",title:"Turning Point - Keke",description:"Keke was my team's final competitive robot for the VRC season Turning point, my senior year of high school.  This robot used a catapult to shoot two balls at once to shoot two flags at once, could pick up and score caps and place them on poles, and could scrape balls off of caps or the platform.",date:"2019-04-30T00:00:00.000Z",tags:[{label:"vex",permalink:"/projects/tags/vex"},{label:"turning point",permalink:"/projects/tags/turning-point"},{label:"software",permalink:"/projects/tags/software"},{label:"hardware",permalink:"/projects/tags/hardware"},{label:"cad",permalink:"/projects/tags/cad"}],readingTime:2.83,hasTruncateMarker:!0,authors:[{name:"Jess Zarchi",title:"Roboticist",url:"https://roboticsisez.com",imageURL:"https://github.com/Unionjackjz1.png",key:"jess"}],frontMatter:{slug:"keke",title:"Turning Point - Keke",authors:["jess"],tags:["vex","turning point","software","hardware","cad"]},unlisted:!1,prevItem:{title:"Goofy - Robot in 3 Days",permalink:"/projects/goofy-ri3d"},nextItem:{title:"Spoon Wars",permalink:"/projects/spoonwars"}},l={authorsImageUrls:[void 0]},d=[{value:"Notebook",id:"notebook",level:2}];function c(e){const t={a:"a",br:"br",h2:"h2",img:"img",p:"p",...(0,r.a)(),...e.components};return(0,a.jsxs)(a.Fragment,{children:[(0,a.jsx)(t.p,{children:"Keke was my team's final competitive robot for the VRC season Turning point, my senior year of high school.  This robot used a catapult to shoot two balls at once to shoot two flags at once, could pick up and score caps and place them on poles, and could scrape balls off of caps or the platform."}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/ist1h6ZTdDc?si=6TjNYwcKvkhvQO0I",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0}),"\n",(0,a.jsx)(t.p,{children:"This robot was started in late October and was the robot we took to the World Championship, the culmination of all of the work we put in throughout High School."}),"\n",(0,a.jsxs)(t.p,{children:["My contributions as team captain went to every aspect of the robot.  I wrote autonomous routines using motion profiling, and adding automation while operating to make it easier on the driver.  I designed different stable and low-slop joints than Pancake, but most of all designed a robot that required very little maintenance after taking a beating.\r\n",(0,a.jsx)(t.img,{src:o(71114).Z+"",width:"4032",height:"3024"})]}),"\n",(0,a.jsx)(t.h2,{id:"notebook",children:"Notebook"}),"\n",(0,a.jsx)(t.p,{children:"In VEX teams can create engineering notebooks and can win awards based on those notebooks and an interview process.  This is the notebook, our build/software log, that we made for this robot."}),"\n",(0,a.jsx)(t.p,{children:"This was never finished, so I'll add a summary of the remainder of the season below."}),"\n",(0,a.jsx)(t.p,{children:(0,a.jsx)(t.a,{href:"https://docs.google.com/document/d/1omhGB65uhTlaZRZvgxiF9jmN33fIssLbpcdErRU2LSE/edit?usp=sharing",children:"https://docs.google.com/document/d/1omhGB65uhTlaZRZvgxiF9jmN33fIssLbpcdErRU2LSE/edit?usp=sharing"})}),"\n",(0,a.jsx)(t.p,{children:"We took the robot to SLO and were very happy with the performance, ranking 3rd and advancing to the finals.  Our biggest shortcoming was our autonomous not doing enough.  To be fair to our SLO performance, we were working on such a short schedule with how recently we got V5 and were able to put everything on the robot.  But there was something new we wanted to try."}),"\n",(0,a.jsx)(t.p,{children:"Teams have started making mechanisms to intake the balls off of caps during autonomous and using them to increase the efficiency of their paths.  We have an extra motor but would like to use it elsewhere, so we came up with a passive idea.  When our cap arm was raised it would release a rubber band allowing this standoff to fall into a cap, and when we drove backward the ball would tip into our robot.  This worked ok but was inconsistent and hindered intaking. So we decided to try something else."}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/sLf9FCNjxXg?si=PpYmkTMX0hM2RHRr",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0}),"\n",(0,a.jsx)(t.p,{children:"We decided to go a more typical route and make a motored arm, we called this a scraper.  This allowed us to tip caps, flip caps, and take balls off of caps and the platform."}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/q3p2t34UsUw?si=WRuaxvga89343oH4",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0}),"\n",(0,a.jsx)(t.p,{children:"Soon we had to compete at Google, a signature event, where the winners would qualify for the World Championship.  We continued to practice and iterate on mechanisms that would fail to make them more robust.  We got picked in 8th place, and we made it to the semi-finals where we lost to the champions.  But, our Quarter Finals match is a good one.  We were against 1st place and our alliance was having trouble and was working on the robot.  The event couldn't wait any longer so we had to play as 1 team against 2.  And against all odds (with some luck) we ended up winning the match!"}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/W3HrmSFPUpA?si=sLM_iQXf683_HbLx",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0}),"\n",(0,a.jsx)(t.p,{children:"We ended up taking this robot to the State Championship and got picked for eliminations by 2nd place, and we advanced to Finals which qualified us for the World Championship."}),"\n",(0,a.jsx)(t.p,{children:"Between the State Championship and World Championship we wanted to iterate everything.  Our drive struggled to get onto the platform, and our intake wasn't very fast, our scraper would get caught in the net sometimes."}),"\n",(0,a.jsxs)(t.p,{children:["We started fixing our list of problems by changing the shape of our drive.  We exposed the front wheel so as we climbed the platform it was easier to get on.  We also redid our intake structure to make sure it was much stronger.\r\n",(0,a.jsx)(t.img,{src:o(7286).Z+"",width:"4032",height:"3024"})]}),"\n",(0,a.jsxs)(t.p,{children:["To stop our scraper from getting entangled in the net we angled it back farther.  This required changing how the structure was done and needed chains instead of gears to fit everything.",(0,a.jsx)(t.br,{}),"\n",(0,a.jsx)(t.img,{src:o(39898).Z+"",width:"4032",height:"3024"})]}),"\n",(0,a.jsx)(t.p,{children:"A big criticism of double catapults is the inability to shoot 1 ball at a time.  We had space for a ball to sit in our intake, so we added a sensor to detect a ball there and stop the intake.  This allowed us flexibility in scoring, and to not waste 2 balls when we only needed to score 1 flag."}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/V6CQSywE5aw?si=X8tKsGa6JgXnVQVj",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/iCO3P55ZqEU?si=ol17lvWTlesXVRUx",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0}),"\n",(0,a.jsx)(t.p,{children:"And then it was off to the world championships!  We went 7-3, got picked by the 3rd seed, and advanced to the finals of our division.  And we got some pretty good highlights..."}),"\n",(0,a.jsx)("iframe",{width:"560",height:"315",src:"https://www.youtube.com/embed/AX5zH4IKJ5M?si=oKlNfiKg78-kU9UU",title:"YouTube video player",frameborder:"0",allow:"accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture; web-share",allowfullscreen:!0})]})}function h(e={}){const{wrapper:t}={...(0,r.a)(),...e.components};return t?(0,a.jsx)(t,{...e,children:(0,a.jsx)(c,{...e})}):c(e)}},39898:(e,t,o)=>{o.d(t,{Z:()=>a});const a=o.p+"assets/images/scraper-ecf4bba94c90c856692e89e81efe2da1.jpg"},7286:(e,t,o)=>{o.d(t,{Z:()=>a});const a=o.p+"assets/images/start_of_rebuild-fc38eb9978f3406aaa117da305d86d10.jpg"},71114:(e,t,o)=>{o.d(t,{Z:()=>a});const a=o.p+"assets/images/worlds-35d80d155b69486c6a75ff06af7e00be.jpg"},11151:(e,t,o)=>{o.d(t,{Z:()=>s,a:()=>n});var a=o(67294);const r={},i=a.createContext(r);function n(e){const t=a.useContext(i);return a.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function s(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(r):e.components||r:n(e.components),a.createElement(i.Provider,{value:t},e.children)}}}]);